    if not strarr or k > len(strarr) or k <= 0:

        return ""



    if k == 1:

        return max(strarr, key=len)



    # Now we can get on with the good stuff

    longest = "".join(strarr[0:k])

    longest_len = len(longest)

    for i in range(1, len(strarr) - k + 1):

        substr = "".join(strarr[i:k+i])

