def format_duration(seconds):

    if seconds == 0:

        return "now"



    # Create a tuple containing all possible units

    time_units = ("year", "day", "hour", "minute", "second")



    # Create a dictionary with times in seconds

    time_units_dict = {

        "year": 31536000,

        "day": 86400,

        "hour": 3600,

        "minute": 60,

        "second": 1

    }



    time_units_cache = []

    for unit in time_units:

        time_basis = time_units_dict[unit]

        units = seconds // time_basis



        if units == 0:

            continue



        seconds -= units * time_basis



        formatted_units = f"{units} {unit}"

        if units > 1:

            formatted_units += "s"



        time_units_cache.append(formatted_units)





    # Format the output string

    num_units = len(time_units_cache)

    if num_units == 1:

        return time_units_cache[0]



    formatted_time = ""

    for i, time in enumerate(time_units_cache):

        formatted_time += time

        if i < num_units - 2:

            formatted_time += ", "

        elif i < num_units - 1:

            formatted_time += " and "



    return formatted_time

def decrypt(encrypted_text, n):

    if not encrypted_text or n <= 0:

        return encrypted_text



    odds = encrypted_text[:len(encrypted_text) // 2]

    evens = encrypted_text[len(encrypted_text) // 2:]

    for i in range(n):

        decrypted = ""

        for j in range(len(encrypted_text)):

            if j % 2 == 0:

                decrypted += evens[j // 2]

            else:

                decrypted += odds[j // 2]

        odds = decrypted[:len(encrypted_text) // 2]

        evens = decrypted[len(encrypted_text) // 2:]



    return decrypted





def encrypt(text, n):

    if not text or n <= 0:

        return text



    for i in range(n):

        str1, str2 = "", ""

        for i, c, in enumerate(text):

            if i % 2 == 0:

                str1 += c

            else:

                str2 += c



        text = str2 + str1



    return text

def duplicate_encode(word):

