def find_nb(m):

    # This is the sum of the first n cubes

    def find_sum(n):

        return ((n * (n + 1)) // 2) ** 2



    left = 0

    right = m

    while left <= right:

        mid = (left + right) // 2

        volume = find_sum(mid)

        if volume == m:

            return mid



        if volume > m:

            right = mid - 1

        elif volume < m:

            left = mid + 1



    return -1

